import './homeCss.css';
function Home(){
    return(
        <>
            <div className='bgImg'>
                <div className='head'>
                    <h1 id='de'>Dariyalal Electronics</h1>
                </div>
                <div className='buttonDiv button1'>
                    <button className='button'><span>Get Profit/Loss statement</span></button>
                </div>
                <div className='buttonDiv button2'>
                    <button className='button'><span>Available Stock</span></button>
                </div>
                <div className='buttonDiv button3'>
                    <button className='button'><span>Add Stock</span></button>
                </div>
            </div>
        </>
    );
}

export default Home;
